import React, { Fragment } from 'react';

import styled from 'styled-components';
import DataForm from '../../styled/DataForm';
import DataField from '../../styled/DataField';
import SendForm from '../../styled/SendForm';

const Title = styled.h3`
	letter-spacing: 1.25px;
	margin-bottom: 0.75em;
`;

const StyledSubmit = styled(SendForm)`
	display: inline-block;
	margin: 1.5em 0 0.75em 0;
`;

const Register = () => {
	return (
		<Fragment>
			<DataForm>
				<Title>Register</Title>
				<DataField>
					<label for='full-name'>fullname</label>
					<input type='text' id='full-name' />
				</DataField>
				<DataField>
					<label for='email'>email </label>
					<input type='text' id='email' />
				</DataField>
				<DataField>
					<label for='Password'>password </label>
					<input type='text' id='Password' />
				</DataField>

				<StyledSubmit>Submit</StyledSubmit>
			</DataForm>
		</Fragment>
	);
};

export default Register;
